﻿var CreateInstanceFormUIManager = function (imageElement, generatorInput, imageInput, generatorTypeID, panels, text0, text1, text2, text3) {

    this.eventNamespace = 'CreateInstanceFormUIManager';

    this.imageElement = $(imageElement);
    this.originalImageSrc = this.imageElement.attr('src');
    this.generatorInput = $(generatorInput);
    this.imageInput = $(imageInput);
    this.generatorTypeID = generatorTypeID;
    this.panels = panels;
    this.text0 = $(text0);
    this.text1 = $(text1);
    this.text2 = $(text2);
    this.text3 = $(text3);
    this.isTextDirty = false;

    this.previewImageInterval = null;

    this.getPreviewImageUrl = function () {
        var escapeText = function (s) {
            return (s || '').replace(/&/g, escape('&')).replace(/\?/g, escape('?'));
        };



        if ((!this.text0.val()) && (!this.text1.val())) {
            return '{0}/images/{1}x/{2}.jpg'.format(Urls.ImageStoreWebServiceHost, this.imageElement.width(), this.imageInput.val());
        }

        return '{0}/Instance/Preview?imageID={1}&generatorTypeID={2}&panels={3}&text0={4}&text1={5}&text2={6}&text3={7}'.format(
            //'http://preview.images.memegenerator.net',
            Urls.ImageStoreWebServiceHost,
            //Urls.ImageStoreWebServiceHost,
            this.imageInput.val(),
            this.generatorTypeID,
            this.panels,
            escapeText(this.text0.val()),
            escapeText(this.text1.val()),
            escapeText(this.text2.val()),
            escapeText(this.text3.val())
            );
    };

    this.setPreviewImage = function () {
        if (!this.imageInput.val()) return;

        if (this.imageInput.val() == 0) return;

        if (!this.isTextDirty) return;

        var url = this.getPreviewImageUrl();

        if (url != this.imageElement.attr('src')) {
            $('#mainImageLoadingIndicator').show();
            $('.profileMainImage').css('visibility', 'hidden');
            $('#templates_list').hide();
            this.imageElement.attr('src', url);
            window.setTimeout(function () {
                $('#mainImageLoadingIndicator').hide();
                $('.profileMainImage').css('visibility', 'visible');
                $('#templates_list').show();
            }, 800);
        }
    };

    this.setGeneratorAndImage = function (generator) {
        this.isTextDirty = true;
        this.generatorInput.val(generator.generatorID);
        this.imageInput.val(generator.imageID);
        this.setPreviewImage();
    };

    this.bindPreviewImage = function () {
        if (this.previewImageInterval) window.clearInterval(this.previewImageInterval);
        this.previewImageInterval = window.setInterval(this.setPreviewImage.createDelegate(this), 800);
    };

    this.bindTextInputs = function () {
        var setTextDirty = function() { this.isTextDirty = true; }.bind(this);
        this.text0.bind('keyup', setTextDirty);
        this.text1.bind('keyup', setTextDirty);
        this.text2.bind('keyup', setTextDirty);
        this.text3.bind('keyup', setTextDirty);
    };

    this.bindTemplates = function (templateElements) {
        $(templateElements).unbind('click.' + this.eventNamespace);
        $(templateElements).bind('click.' + this.eventNamespace, function (event) {
            var element = $(event.target);
            var generator = JSON.parse(element.attr('data-generator'));
            this.setGeneratorAndImage(generator);
        } .createDelegate(this));
    };

    this.bindGenerators = function (generatorElements, templatesContainerElement, templatesPartialViewUrlFormat, onGeneratorTemplatesLoaded) {
        $(generatorElements).unbind('click.' + this.eventNamespace);
        $(generatorElements).bind('click.' + this.eventNamespace, function (event) {
            var element = $(event.target);
            var generator = JSON.parse(element.attr('data-generator'));
            this.setGeneratorAndImage(generator);

            if (templatesContainerElement) {
                var url = templatesPartialViewUrlFormat.format(generator.urlName);
                $.get(url, function (data) {
                    $(templatesContainerElement).html(data);
                    if (onGeneratorTemplatesLoaded) onGeneratorTemplatesLoaded(generator);
                });
            }
        } .createDelegate(this));
    };

    $(document).ready(function () {

        $('.profileMainImage').bind('load', function () {
            $('#mainImageLoadingIndicator').hide();
            $('.profileMainImage').css('visibility', 'visible');
            $('#templates_list').show();
        });

        this.bindTextInputs();
        this.bindPreviewImage();

    } .createDelegate(this));

};
﻿var overlayID = 'FileDragAndDropOverlay';

function CreateDragAndDropFileHandler(onDrop) {

    var text0 = 'Drop file anywhere to upload';
    var text1 = 'Processing...';

    var noopHandler = function (evt) {
        evt.stopPropagation();
        evt.preventDefault();
    };

    var handleReaderLoadEnd = function (evt) {
        dragExitHandler(evt);

        overlay.innerHTML = text0;

        onDrop(evt.target.result);
    }

    var handleFiles = function (files) {
        overlay.innerHTML = text1;

        var file = files[0];

        var reader = new FileReader();

        // init the reader event handlers
        reader.onloadend = handleReaderLoadEnd;

        // begin the read operation
        reader.readAsDataURL(file);
    };

    var overlay = document.createElement('div');
    overlay.id = overlayID;
    overlay.style.position = 'absolute';
    overlay.style.width = '100%';
    overlay.style.height = '100%';
    overlay.style.top = '0px';
    overlay.style.left = '0px';
    overlay.style.paddingTop = '20%';
    overlay.style.backgroundColor = '#666';
    overlay.style.textAlign = 'center';
    overlay.style.fontSize = '60px';
    overlay.style.color = 'white';
    overlay.style.opacity = 0.8;
    overlay.innerHTML = text0;

//    var overlayText = document.createElement('div');
//    overlayText.innerHTML = text0;
//    overlayText.style.marginTop = '25%';
//    overlayText.style.textAlign = 'center';
//    overlayText.style.fontSize = '60px';
//    overlayText.style.border = '5px dashed gray';
//    overlayText.style.backgroundColor = 'white';
//    overlayText.style.display = 'inline-block';
//    overlayText.style.padding = '20px';
//    overlayText.style.borderRadius = '20px';
//    overlay.appendChild(overlayText);

    overlay.style.display = 'none';

    document.body.appendChild(overlay);

    var dragEnterHandler = function (evt) {
        overlay.style.display = 'block';
    };

    var dragExitHandler = function (evt) {
        overlay.style.display = 'none';
    };

    var dropHandler = function (evt) {
        noopHandler(evt);

        var files = evt.dataTransfer.files;

        if (files.length > 0) handleFiles(files);
    };

    // init event handlers
    document.body.addEventListener("dragenter", dragEnterHandler, false);
    overlay.addEventListener("dragleave", dragExitHandler, false);
    overlay.addEventListener("click", dragExitHandler, false);
    document.body.addEventListener("dragover", noopHandler, false);
    document.body.addEventListener("drop", dropHandler, false)
    document.body.addEventListener("keyup", function (evt) { if (evt.keyCode == 27) dragExitHandler(evt); }, false);
}
