	var googleImageSearchUrl = 'https://ajax.googleapis.com/ajax/services/search/images?v=1.0&rsz=' + 8 + '&start=' + startIndex + '&userip=' + userIP + '&key=' + googleSearchApiKey + '&callback=GoogleImageSearch.onSearchComplete' + '&q=' + escape(query);

	var fileref = document.createElement('script');
