function user_showLogin() {

    window.isPageLoad = false;

    $('.login_button').hide();
    $('input.search').hide();
    $('#MgUserLoginContainer').show('fast').find('input[name=usernameOrEmail]').trigger('focus');
    

     $('.MgUserLoggingError').empty();

    $('#user_login').show('normal').find('input[name=usernameOrEmail]').trigger('focus');
    $('#user_signup').hide('normal');
    $('#user_resetPassword').hide('normal');
    $('#user_changePassword').hide('normal');
}

function user_showSignup() {
    $('.MgUserLoggingError').empty();

    $('#user_login').hide('normal');
    $('#user_signup').show('normal').find('input[name=email]').trigger('focus');
    $('#user_resetPassword').hide('normal');
    $('#user_changePassword').hide('normal');
}

function user_showResetPassword() {
    $('.MgUserLoggingError').empty();

    $('#user_login').hide('normal');
    $('#user_signup').hide('normal');
    $('#user_resetPassword').show('normal').find('input[name=email]').trigger('focus');
    $('#user_changePassword').hide('normal');
}

function user_showChangePassword() {
    $('.MgUserLoggingError').empty();

    $('#user_login').hide('normal');
    $('#user_signup').hide('normal');
    $('#user_resetPassword').hide('normal');
    $('#user_changePassword').show('normal');
}

