function doSuperTabs() {
    $(this).children().each(
        function (index) {
            if (index == 0) {
                doSuperTabsHeaders($(this));
            } else {
                doSuperTabsBody($(this));
            }
        }
    );
        $(this).find('> div:first-child > a:first-child').click();
        $(this).find('> div:first-child > a[data-default=1]').click();

}

function doSuperTabsHeaders(headerDiv) {
    $(headerDiv).children().each(
        function (index) {
            $(this).click(superTabsOnClick);
            $(this).mouseover(superTabsOnOver);
            $(this).mouseout(superTabsOnOut);

            $(this).children().each(
                function (index) {
                    if (index != 1)
                        $(this).hide();
                }
            );
        }
    );
}

function superTabsOnClick() {
    $(this).parent().children().each(function () { $(this).removeClass("active"); });
    $(this).addClass("active");
    $(this).parent().children().each(function () { $(this).mouseout() });
    $(this).children().each(
        function (index) {
            if (index == 0) {
                //alert($(this).attr("src"));
                $(this).show();
            } else {
                $(this).hide();
            }
        }
    );
    //show tab content:
    var TEMP_href = $(this).attr("href");
    $(this).parent().parent().children().each(function (index) {
        if (index != 0)
            $(this).hide();

        if (("#" + $(this).attr("id")) == TEMP_href) {
            $(this).show();
        };
    });
    //reorder z-index:

    var TEMP_z = $(this).css("z-index");
    //alert(TEMP_z);

    $(this).parent().children().each(
        function (index) {
            if ($(this).css("z-index") > TEMP_z) {
                $(this).css("z-index", $(this).css("z-index") - 1);
            }
        }
    );
    $(this).css("z-index", $(this).parent().children().length - 1);

    return false;
}

function superTabsOnOver() {
    if ($(this).hasClass("active")) {
        return;
    }

    $(this).children().each(
        function (index) {
            if (index == 2) {
                $(this).show();
            } else {
                $(this).hide();
            }
        }
    );
}

function superTabsOnOut() {
    if ($(this).hasClass("active")) {
        return;
    }
    $(this).children().each(
        function (index) {
            if (index == 1) {
                $(this).show();
            } else {
                $(this).hide();
            }
        }
    );
}



