function appendCssFile(url) {
	var cssId = escape(url);  // you could encode the css path itself to generate id..
	if (!document.getElementById(cssId)) {
		var head = document.getElementsByTagName('head')[0];
		var link = document.createElement('link');
		link.id = cssId;
		link.rel = 'stylesheet';
		link.type = 'text/css';
		link.href = url;
		link.media = 'all';
		head.appendChild(link);
	} 
}



// enforce MAXLENGTH on TEXTAREA elements
function EnforceMaxLengthOnTextAreas() {
	var txts = document.getElementsByTagName('TEXTAREA')

	for (var i = 0, l = txts.length; i < l; i++) {
		if (/^[0-9]+$/.test(txts[i].getAttribute("maxlength"))) {
			var func = function () {
				var len = parseInt(this.getAttribute("maxlength"), 10);

				if (this.value.length > len) {
					alert('Maximum length exceeded: ' + len);
					this.value = this.value.substr(0, len);
					return false;
				}
			}

			txts[i].onkeyup = func;
			txts[i].onblur = func;
		}
	}
}





function CreateIFrameFileUploader(iframeName, iframeActionUrl, dataFormat, onSubmit, onError) {
	var container = $('<div />');

	var iframe = null;
	try {
		// fucking IE
		iframe = document.createElement('<iframe name="' + iframeName + '" />');
	} catch (ex) {
		iframe = document.createElement('iframe');
	}
	iframe = $(iframe);
	iframe.attr('id', iframeName);
	iframe.attr('name', iframeName);
	iframe.css('display', 'none');

    if (!onError) onError = function() {};
    var onErrorCallbackName = iframeName + '_onErrorCallback_' + (new Date()).valueOf();
    window[onErrorCallbackName] = onError;

	// fucking IE. if you set the enctype property via jQuery it won't work.
	var form = $('<form target="' + iframeName + '" method="post" enctype="multipart/form-data" action="' + iframeActionUrl + '" />');

	form.append($('<input type="hidden" id="' + iframeName + '_dataFormat" name="_dataFormat" value="' + dataFormat + '" />'));
	form.append($('<input type="hidden" id="' + iframeName + '_postMessageOrigin" name="_postMessageOrigin" value="' + (window.location.protocol + '//' + window.location.host) + '" />'));
	form.append($('<input type="hidden" id="' + iframeName + '_onErrorCallback" name="_onErrorCallback" value="' + onErrorCallbackName + '" />'));

	var file = $('<input type="file" id="' + iframeName + '_file" name="' + iframeName + '_file" />');

	file.bind('change', function () {
		if (!this.value) return;
		var formElement = this.parentNode;
		var formParentElement = formElement.parentNode;
		//$(formElement).appendTo('body');
		formElement.submit();
		//$(formElement).appendTo(formParentElement);
		if (onSubmit) onSubmit();
	});

	form.append(file);
	container.append(iframe);
	container.append(form);

	return container;
}






/*
**  Returns the caret (cursor) position of the specified text field.
**  Return value range is 0-oField.length.
*/
function GetCaretPosition(oField) {

	// Initialize
	var iCaretPos = 0;

	// IE Support
	if (document.selection) {

		// Set focus on the element
		oField.focus();

		// To get cursor position, get empty selection range
		var oSel = document.selection.createRange();

		// Move selection start to 0 position
		oSel.moveStart('character', -oField.value.length);

		// The caret position is selection length
		iCaretPos = oSel.text.length;
	}

	// Firefox support
	else if (oField.selectionStart || oField.selectionStart == '0')
		iCaretPos = oField.selectionStart;

	// Return results
	return (iCaretPos);
}


/*
**  Sets the caret (cursor) position of the specified text field.
**  Valid positions are 0-oField.length.
*/
function SetCaretPosition(oField, iCaretPos) {

	// IE Support
	if (document.selection) {

		// Set focus on the element
		oField.focus();

		// Create empty selection range
		var oSel = document.selection.createRange();

		// Move selection start and end to 0 position
		oSel.moveStart('character', -oField.value.length);

		// Move selection start and end to desired position
		oSel.moveStart('character', iCaretPos);
		oSel.moveEnd('character', 0);
		oSel.select();
	}

	// Firefox support
	else if (oField.selectionStart || oField.selectionStart == '0') {
		oField.selectionStart = iCaretPos;
		oField.selectionEnd = iCaretPos;
		oField.focus();
	}
}


