function notify() {

	var args = arguments;

	if (args.length == 1) {
		$.gritter.add({
			title: args[0],
			text: ' '
		});
	}
	else {
		if (args.length == 2) {
			$.gritter.add({
				title: args[0],
				text: args[1]
			});
		}
		else {
			if (args.length == 3) {
				$.gritter.add({
					image: args[0],
					title: args[1],
					text: args[2]
				});
			}
			else{
			    if (args.length == 4) {
			        $.gritter.add({
			            image: args[0],
			            title: args[1],
			            text: args[2],
			            class_name: args[3]
			        }); 
                }
                else {
    				throw 'Invalid number of arguments passed to notify(...)';
			    }
            }
		}
	}
}


