// tutorials (cookie based)
var mgTutorialsCookieName = 'mgTutorials';
var mgTutorialsCookieExpire = 365;
function isInTutorial(name) {
    var str_tutorials = readCookie(mgTutorialsCookieName) || "{}";

    var tutorials = JSON.parse(str_tutorials);
    return tutorials[name];
}

function setTutorial(name, val) {
    var str_tutorials = readCookie(mgTutorialsCookieName) || "{}";
    var tutorials = JSON.parse(str_tutorials);
    tutorials[name] = val;

    var str_tutorialNew = JSON.stringify(tutorials);
    createCookie(mgTutorialsCookieName, str_tutorialNew, mgTutorialsCookieExpire);
}





