﻿function Voter_OnUpVoteClick(voterElement) {
    var container = $(voterElement);

    var status = Voter_GetVoterStatus(container);

    Voter_SetVoterStatus(container, (status == 1) ? 0 : 1);
}

function Voter_OnDownVoteClick(voterElement) {
    var container = $(voterElement);

    var status = Voter_GetVoterStatus(container);

    Voter_SetVoterStatus(container, (status == -1) ? 0 : -1);
}

function Voter_GetVoterStatus(container) {
    var selectedItems = container.find('.selected');

    if (selectedItems.length == 0) return null;

    if ($(selectedItems[0]).hasClass('upvote')) return 1;

    if ($(selectedItems[0]).hasClass('downvote')) return -1;

    throw 'not implemented';
}

function Voter_SetVoterStatus(container, status) {
    var $score = container.find('.score');

    var score = parseInt($score.text()) - Voter_GetVoterStatus(container);

    var entityName = container.attr('data-entity-name');
    var entityID = container.attr('data-entity-id');

    var koData = ko.dataFor(container[0]);

    container.find('*')
        .removeClass('selected')
        .removeClass('upvoted')
        .removeClass('downvoted')
        .removeClass('btn-success')
        .removeClass('btn-danger')
    ;

    if (status == 1) {
        container.find('.upvote').addClass('selected');//.addClass('btn-success');
        container.find('.score').addClass('upvoted');
        $score.text(score + 1);
    }

    if (status == -1) {
        container.find('.downvote').addClass('selected');//.addClass('btn-danger');
        container.find('.score').addClass('downvoted');
        $score.text(score - 1);
    }

    if (status == 0) {
        $score.text(score);
    }

    $.post('/Voter/Vote', { entityName: entityName, entityID: entityID, voteScore: status })
        .done(function(result) {
            if (koData) {
                for (var k in result) koData[k] = result[k];
            }
        }.bind(this));
}
